import React, { Component } from "react";
import "./App.css";

class App extends Component {
  SubmitHandler = () => {
    this.state;
  };
  render() {
    return (
      <div>
        <form>
          <div class="wrap">
            <input class="input_box" type="text" placeholder="Ask a question" />
            <button class="search_icon" type="submit">
              <i class="fa fa-search" />
            </button>
          </div>
        </form>
      </div>
    );
  }
}

export default App;
